import time

def timer(func):
    def wrapper(*args, **kwargs):
        start_time = time.time()
        result = func(*args, **kwargs)
        end_time = time.time()
        print(f"–í—Ä–µ–º—è –≤—ã–ø–æ–ª–Ω–µ–Ω–∏—è —Ñ—É–Ω–∫—Ü–∏–∏ {func.__name__}: {end_time - start_time} —Å–µ–∫—É–Ω–¥")
        return result
    return wrapper

@timer
def my_function():
    time.sleep(2)
    return "–ì–æ—Ç–æ–≤–æ"

print(my_function())


