def logger(func):
    def wrapper(*args, **kwargs):
        print(f"–í—ã–∑–æ–≤ —Ñ—É–Ω–∫—Ü–∏–∏ {func.__name__} —Å –∞—Ä–≥—É–º–µ–Ω—Ç–∞–º–∏ {args}, {kwargs}")
        result = func(*args, **kwargs)
        print(f"–§—É–Ω–∫—Ü–∏—è {func.__name__} –≤–µ—Ä–Ω—É–ª–∞ —Ä–µ–∑—É–ª—å—Ç–∞—Ç: {result}")
        return result
    return wrapper

@logger
def add_numbers(a, b):
    return a + b

print(add_numbers(2, 3))


3. –î–µ–∫–æ—Ä–∞—Ç–æ—Ä –¥–ª—è –∫—ç—à–∏—Ä–æ–≤–∞–Ω–∏—è —Ä–µ–∑—É–ª—å—Ç–∞—Ç–æ–≤ —Ñ—É–Ω–∫—Ü–∏–∏:

